import { css } from '@emotion/css';

export const styContainer= css`
  width: 80%;
  margin: 0 auto 24px;

  .sty-image: {
    background-repeat: no-repeat;
    background-size: 100%;
    display: inline-block;
    margin: 0px auto;
    position: relative;
    text-align: center;
    width: 100%;
    height: 250px;

    img {
      object-fit: cover;
      width: 100%;
      height: 250px;
      border-radius: 16px;
    }
  }
`
